import React from 'react';
import github from '../images/ic-navbar-github.svg'

function Margin() {
  return (
  <div className="margin">
      <div className="left">
        <img src={github} alt="github" />
        <img src={"../images/ic-navbar-linkedin.svg"} alt="linkedin" />
      </div>
      <div className="right">
        <span>Contacts</span>
      </div>
      <div className="top">
        <h1>Myrian Katto</h1>
      </div>
</div>
  );
}

export default Margin;
